// DeleteUniqueIndexCache 删除索引存在的缓存
func (a *AiChatMessageRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.AiChatMessage) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, a.cache.Key(CacheAiChatMessageByConditionPrefix))
	keys = append(keys, a.cache.Key(CacheAiChatMessageUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[a.cache.Key(CacheAiChatMessageByIDPrefix, item.ID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatMessageUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatMessageByAdminIDPrefix, item.AdminID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatMessageUnscopedByAdminIDPrefix, item.AdminID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatMessageByConversationIDPrefix, item.ConversationID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatMessageUnscopedByConversationIDPrefix, item.ConversationID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatMessageByTenantIDPrefix, item.TenantID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiChatMessageUnscopedByTenantIDPrefix, item.TenantID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := a.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
